  false,\n\t\"url\": null,\n\t\"notes\": \"This 1989 Annual Big Game Hunting Program
  outlines the reasons and regulations for white-tailed deer hunting on Parker River
  National Wildlife Refuge.  The white-tailed deer population has grown to exceed
  the recommended carrying capacity for the Island.  The Refuge will be closed for
  6 days in order to carry out the controlled deer hunt.  Limited hunting will be
  allowed by permit only; the bag limit is one antlerless deer per hunter.  Rules
  and procedures for hunter selection are attached as well as maps of the designated
  hunting zones.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
